scriptlet.script:
try{
	indxToPackage = indxToPackage;
	mssPackageType=mssPackageType;

	var packaged;
	//if(mssPackageType == '' || indxToPackage == '' || mssPackageType == "null" || indxToPackage == "null" || mssPackageType == "NULL" || indxToPackage == "NULL")

	//if(mssPackageType == '' && indxToPackage == '') this condition check can be used instead of lot of checks
	// in order to provide Backward compatibility, below checks are implemented in if condition		
	//if((mssPackageType == '' || mssPackageType == 'null' || mssPackageType == 'NULL')  && (indxToPackage == '' || indxToPackage == 'null' || indxToPackage == 'NULL'))
	//indxToPackage needs to be compared with 'None' value instead of null
	if((mssPackageType == '' || mssPackageType == 'null' || mssPackageType == 'NULL')  && (indxToPackage == 'None' || indxToPackage == 'none'))
	{
	packaged ='N';
	scriptletContext.put("packaged", packaged);
	response = "success";
	} 
	else
	{
	packaged = 'Y';
	scriptletContext.put("packaged", packaged);
	response = "success";
	}
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response

try{
	switchFeeWaived=indxSwitchFeeWaived;
	switchToFlexiProduct = switchToFlexiProduct;
	packaged=packaged;

	var switchingFee;
	if(switchFeeWaived == 'N' && switchToFlexiProduct == 'Y')
	{
	switchingFee = 350;
	scriptletContext.put("switchingFee", switchingFee);
	response = "success";
	} 
	else if(packaged == 'N' && switchFeeWaived == 'N')
	{
	switchingFee = 300;
	scriptletContext.put("switchingFee", switchingFee);
	response = "success";
	}
	else
	{
	switchingFee = 0;
	scriptletContext.put("switchingFee", switchingFee);
	response = "success";
	}
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response

try{
	switchToRocketProduct = switchToRocketProduct;
	switchToFixedProduct = switchToFixedProduct;
	packageComment = packageComment;
	packaged = packaged;

	var maintenanceFee;
	var maintenanceFeeComment;
	if((switchToFixedProduct == 'Y' || switchToRocketProduct == 'Y') && packaged == 'N')
	{
	maintenanceFee = 8;
	maintenanceFeeComment = "$8 PER MONTH";
	scriptletContext.put("maintenanceFee", maintenanceFee);
	scriptletContext.put("maintenanceFeeComment", maintenanceFeeComment);
	response = "success";
	}
	else
	{
	maintenanceFee = 0;
	maintenanceFeeComment = "N/A " + packageComment;
	scriptletContext.put("maintenanceFee", maintenanceFee);
	scriptletContext.put("maintenanceFeeComment", maintenanceFeeComment);
	response = "success";
	}
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response

try{
	switchFeeWaived=indxSwitchFeeWaived;
	packaged=packaged;
	switchingFee = switchingFee;
	packageComment = packageComment;

	var switchingFeeComment;
	if(switchingFee == 0 && switchFeeWaived == 'Y')
	{
	switchingFeeComment = "$0.00 (AUTHORISATION/WAIVER REC'D)" ;
	scriptletContext.put("switchingFeeComment", switchingFeeComment);
	response= "success";
	}
	else if(packaged == 'N' && switchingFee == 300)
	{
	switchingFeeComment = "$300.00";
	scriptletContext.put("switchingFeeComment", switchingFeeComment);
	response = "success";
	}
	else if(packaged == 'N' && switchingFee == 350)
	{
	switchingFeeComment = "$350.00";
	scriptletContext.put("switchingFeeComment", switchingFeeComment);
	response = "success";
	}
	else
	{
	switchingFeeComment = "N/A " + packageComment;
	scriptletContext.put("switchingFeeComment", switchingFeeComment);
	response = "success";
	}
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response
